import React, { useState } from 'react';
import './App.css';
import logo from './Pictures/logo.png';
import contactImage from "./Pictures/contactImage.jpg";
import { Button, Form, Container, Row, Col } from 'react-bootstrap';
import axios from 'axios';

const QuotePage = () => {
    // State to hold form data
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        company: '',
        country: 'United States',
        address1: '',
        address2: '',
        city: '',
        state: '',
        zip: '',
        email: '',
        phone: '',
        preferredContact: 'Email',
        eventDate: '',
        timePeriod: '',
        serviceRequested: '',
        numberOfGuests: '',
        numberOfCars: '',
        comments: ''
    });

    // Handle changes in form inputs
    const handleChange = (event) => {
        const { name, value } = event.target;
        setFormData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    // Handle form submission
    const handleSubmit = (event) => {
        event.preventDefault();
        axios.post('http://localhost:4000/api/quotes', formData)
            .then(response => {
                alert('Quote request sent successfully!');
                console.log(response.data);
            })
            .catch(error => {
                console.error('Failed to send quote request:', error);
                alert('Failed to send quote request.');
            });
    };

    return (
        <div>
            <nav className="navbar">
                <div className="logo">
                    <img className="h-10 mr-3" style={{ width: '150px', height: '150px', padding: '5px' }} src={logo} alt="Logo" />
                </div>
                <ul className="nav-links">
                    <li><a href="#valet-parking">Valet Parking</a></li>
                    <li><a href="#commercial-services">Commercial Services</a></li>
                    <li><a href="#locations">Locations</a></li>
                    <li><a href="#careers">Careers</a></li>
                    <li><a href="#about">About</a></li>
                    <li><a href="#contact">Contact</a></li>
                </ul>
                <button className="quote-btn" style={{ padding: '20px', color: 'black', fontSize: '20px' }}>Request a Quote</button>
            </nav>

            <Container>
                <Row>
                    <Col md={6}>
                        <div className="contact-info-section">
                            <div className="contact-text">
                                <h1>INTERESTED IN HAVING US FOR YOUR NEXT EVENT, OR LOOKING FOR EMPLOYMENT? SIMPLY FILL OUT THE FORM BELOW.</h1>
                                <div className="contact-details">
                                    <p><i className="fas fa-envelope"></i> info@peninsulaparking.com</p>
                                    <p><i className="fas fa-phone"></i> (650) 596-5728</p>
                                    <p><i className="fas fa-phone"></i> (855) PEN-PARK</p>
                                    <p><i className="fas fa-map-marker-alt"></i> 541 Taylor Way Suite 12<br />San Carlos, CA 94070</p>
                                    <p><i className="fas fa-clock"></i> Monday - Sunday<br />9:00 AM - 6:00 PM</p>
                                </div>
                            </div>
                            <div className="contact-image">
                                <img src={contactImage} alt="Contact Us" />
                            </div>
                        </div>
                    </Col>
                    <Col md={6}>
                        <h2>Request a Quote</h2>
                        <p>Fill out the form below and get a quote today.</p>
                        <Form onSubmit={handleSubmit}>
                            {/* Dynamically generated form fields */}
                            <Button variant="primary" type="submit">Send</Button>
                        </Form>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}

export default QuotePage;
